    "2013-03-14T15:06:50.171073",nt"name": "cultural-feature-point",nt"isopen":
    false,nt"url": null,nt"notes": "The Geographic Names Information System
    (GNIS) is the Federal standard for geographic nomenclature in support of the U.S.
    Board on Geographic Names. The Cultural Features layer (CULTURAL_FEATURE) in the
    GNIS Web Map Service contains all features in the database with Feature Class of
    Cemetery, Dam, Locale, Mine, Military (historical), Oilfield, Tower, Trail, Well.
    See http://geonames.usgs.gov/domestic/feature_class.htm for feature class values
    and definitions. The CULTURAL_FEATURE250 layer contains large features designated
    by the Geographic Names Office as ones that should be labeled on maps or displays
    with a scale of 1:250,000. See http://geonames.usgs.gov for additional information.",nt"license_title":
